(34, 'http://www.timeshighereducation.co.uk/world-university-rankings/2020/world-ranking', 'World University Rankings 2020 | Times Higher Education (THE)', 'The Times Higher Education World University Rankings 2020 includes almost 1,400 universities across 92 countries, standing as the largest and most diverse university rankings ever to date. The table is based on 13 carefully calibrated performance indicators that measure an institution’s performance across teaching, research, knowledge transfer and international outlook. The', '', 0),
